import './Expenseitem.css'
function Expenseitem() {
  return (
    <div>
      <div>March 23th 2021</div>
      <div>
        <h2>Car insurance</h2>
        <div>$768</div>
      </div>
    </div>
  );
}
export default Expenseitem;
